from at_scale_python_api.models.model import Model


class DataBackedProject(Model):
    def __init__(self, **kwargs):
        super().__init__()
        self.name: str = None
        self.url: str = None
        self.commit: str = None
        self.creator_email: str = None
        self.type: str = None
        self.public: str = None
        self.from_dict(kwargs)
